import './Header.css';

function Header (){ 


    return (
        <>
      <div className="header">
        <div className="centered-div">
          <h1>Div 1</h1>
        </div>
        <div className="centered-div">
          <h1>Div 2</h1>
        </div>
        <div className="centered-div">
          <h1>Div 3</h1>
        </div>

         <button  className="cart-button left-div">Cart</button>

      </div>

      </>
    );
  } 


export default Header;
